import React from 'react';
import { FeaturedProducts, Hero, Services, Contact } from '../components';

const HomePage = () => {
  return (
    <main>
      <Hero />
      <FeaturedProducts />
      <Services />
      <Contact />
    </main>
  );
};

export default HomePage;
